  const [fen, setFen] = useState(in_fen);
  const [orientation, setOrientation] = useState('white');

  //console.log('Received fen:', in_fen);
 //console.log('Current fen:', fen);

  // Update the fen state when the in_fen prop changes
  useEffect(() => {
    setFen(in_fen);
