             !isNaN(parseFloat(str)) // ...and ensure strings of whitespace fail
    } //stackoverflow answered Oct 6, 2008 at 19:24 by Dan

  const handleDrop = ({ sourceSquare, targetSquare, piece }) => {
    // Convert the piece notation to FEN piece notation
  const fenPiece = (piece[0]==="b")? piece.substring(1).toLowerCase(): piece.substring(1).toUpperCase();
  const fileIndex1 = 'abcdefgh'.indexOf(sourceSquare[0]);
