  const fileIndex2 = 'abcdefgh'.indexOf(targetSquare[0]);
  const rankIndex2 = 8 - parseInt(targetSquare[1]); // Get the index of the rank (row)
  const fenArray = fen.split('/');
  let newRank1 = '';
  let newRank2 = '';
