  let prevsum = 0;
  if (sourceSquare !== "spare"){
  for (let i = 0; i < fenArray[rankIndex1].length; i++) {
    const temp = isNumeric(fenArray[rankIndex1][i]) == true ? Number(fenArray[rankIndex1][i]): 1;
    cumsum += temp;
    if (cumsum > fileIndex1) {
      newRank1 += (myFunction(fileIndex1-prevsum+cumsum-fileIndex1));
      for (let j = i; j < fenArray[rankIndex1].length-1; j++) {
        newRank1 += fenArray[rankIndex1][j+1];}
      break;
      } else {
      newRank1 += fenArray[rankIndex1][i];
    }

    prevsum = cumsum;

  }
  fenArray[rankIndex1] = newRank1;
}
  cumsum = 0;
  prevsum = 0;

  for (let i = 0; i < fenArray[rankIndex2].length; i++) {
    const temp = isNumeric(fenArray[rankIndex2][i]) == true ? Number(fenArray[rankIndex2][i]): 1;
    cumsum += temp;
    if (cumsum > fileIndex2) {
      newRank2 += (myFunction(fileIndex2-prevsum)) + (fenPiece) + ( myFunction(cumsum-fileIndex2-1));
      for (let j = i; j < fenArray[rankIndex2].length-1; j++) {
        newRank2 += fenArray[rankIndex2][j+1];}
      fenArray[rankIndex2] = newRank2;

        // Reassemble the FEN string with the modified rank
      const newFen = fenArray.join('/');

        // Update the board position
      setFen(newFen);
      return;
      } else {
      newRank2 += fenArray[rankIndex2][i];
    }

    prevsum = cumsum;

  }
  fenArray[rankIndex2] = newRank2;

  // Reassemble the FEN string with the modified rank
  const newFen = fenArray.join('/');
  // Update the board position
  setFen(newFen);
};

